        "description": "<p>Wear it out. Wear it in. Wear it wherever! This super cozy, incredibly versatile nursing cami is a must-have maternity essential for any new mom or mom-to-be. Featuring a simple, clip-down nursing mechanism - you can easily breastfeed or pump at home or on the go. Not to mention, this piece is perfect for baby snuggling, just sayin'!</p>\n<p><span style=\"font-weight: 400;\"><strong>Size &amp; Fit:</strong> Model is seen wearing a size small at 5'11\".</span></p>\n<ul>\n<li>Nursing Cami<br>\n</li>\n<li>Built-in shelf bra</li>\n<li>Does not include padding</li>\n<li>Clipdown Nursing Function</li>\n<li>Jersey Knit</li>\n<li>95% Cotton / 5% Spandex</li>\n<li>Machine Wash Or Dry Clean</li>\n<li>Imported</li>\n</ul>",
