        "description": "<p><meta charset=\"utf-8\"><span data-mce-fragment=\"1\">Give your back a break with the BumpLift Maia Maternity Pants! Featuring silicone flocking that cradles the bump, these pants relieve pressure from your back and provide light support. You deserve a break, mama, and you'll get one in these pants. In a flattering skinny leg, wear them for work, weekends, or whenever!</span></p>\n<ul>\n<li>This ingenious silicone flocking does double duty!</li>\n<li>Silicone âhelping handsâ literally cradle the bump to provide light support &amp; take some pressure off your back</li>\n<li>No digging or rolling â the silicone and a comfortable edge stitched waistband keeps these pants in place!</li>\n<li>Designed for all-day wear &amp; comfort</li>\n<li>A baby bump plus gravity can equal back pain! With a silicone flocked construction that extends from back to belly, these pants provide light support to keep you comfortable all-day long</li>\n<li>Light support that layers seamlessly under clothes, these are your go-to when you wish you could rock a belly band 24/7.</li>\n<li>Maternity Pants</li>\n<li>Secret Fit Belly - (R) Us Patent Nos. Re43563, Re43531, 7814575, And 7900276</li>\n<li>Skinny Leg</li>\n<li>Ankle Length</li>\n<li>29 Inch Inseam</li>\n<li>Rayon / Nylon / Spandex</li>\n<li>\n<meta charset=\"utf-8\"> <span>Secret Fit Belly: 84% Nylon, 16% Spandex</span>\n</li>\n<li>Machine Washable</li>\n</ul>",
